　AutoStyle アルミエアコンベゼル 2pcs for VW Polo6Cは、Polo6C オートエアコンのダイヤルスイッチの外周を飾る高品質アルミ製のダイヤルリング(ベゼル)になります。取付方法は、純正のエアコンダイヤルスイッチに被せるだけと極めて簡単です。<br><br>●アルミエアコンベゼル 2個セット●カラー：アルミシルバー●材質：アルミニウム●取付方法：純正のエアコンダイヤルスイッチに被せるだけの簡単取付。<br><br>※両面テープを使用しなくても装着できるフィッティングですが、固体差により装着しにくい場合があります。また、両面テープが必要な際は別途ご用意願います。<br><br>適合車種：VW Polo6C※オートエアコン装備車に適合します。<br><br><br><br>インテリア | インテリアその他<BR>※こちらの商品は代引き不可です<tr><td colspan="2">
