シビックのロゴが鮮やかに発光するLEDスカッフプレート。ベースとなるスカッフプレートは鮮やかなステンレス製。発光には青色LEDを採用。ELやネオン管を用いた商品に比べ、インバーターユニットなどが不要で取り付けも簡単。チラつきや高周波ノイズ音もなく安心してご使用になれます。 <br>両面テープで貼り付け、結線するだけの簡単取付。ヒューズ付きハーネスが付属してるので安心です。もちろんリアシート分も含めた4枚セット。<br>■4枚セット　■材質：ステンレス（発光部：LED　■発光色：青　■ヒューズ付ハーネスが付属 <br>対応車種：FD1/2 シビック <br>　車検対応品<br>インテリア/インテリアその他<tr><td colspan="2">
